int testingData(vector<int> imageData, vector<string> detections){    
    vector<vector<string> > metadata;

    int n = imageData.size() /( image_side*image_side);
    int k = n/4;

    for(int i=0;i<n;++i){
       istringstream iss(detections[i]);
       vector<string> tokens{istream_iterator<string>{iss},
             istream_iterator<string>{}};
       metadata.push_back(tokens);
    }

    //Get neural network input

    


	for(int i=0;i<k;++i){
		double score_sum = 0.0;
		int votes = 4*nns.size()*4; //4 (1) flips per nn
			for(int j=0; j<4; ++j){
				//Get image from that
				for(int flip_x=0; flip_x<2;++flip_x)
					for(int flip_y=0; flip_y<2;++flip_y)
					{
					vector<double> input = prepare_data(imageData, metadata[4*i+j],flip_x,flip_y, 4*i+j);
					//Each neural network votes
					for(auto nn: nns){
							
						double score = max(0.0, min(1.0, (nn->feedforward(input))));
						score_sum+=score;
					}
				}
			}	
		g_uuids.push_back(pair<double, int>(score_sum/(float)votes,  to<int>(metadata[4*i][0])));
	}
 

    return 0;
}




vector<int> getAnswer(){
    sort(g_uuids.begin(), g_uuids.end());
	vector<int> answers;	
	answers.reserve(g_uuids.size());
	for(auto & v: g_uuids) 
		answers.push_back(v.second);    
	return answers;
}

